import React, { Component } from 'react';
import Button from '@material-ui/core/Button';
import { connect } from 'react-redux';
import {newRepo} from './../../actions/repo.actions'
import Typography from '@material-ui/core/Typography';
import TextField from '@material-ui/core/TextField';

class NewRepoPage extends Component {
  constructor(props){
    super(props);
    this.state={
      name:"",
      description:"",
      import_url:""
    }
    this.handleName=this.handleName.bind(this);
    this.handleDesc=this.handleDesc.bind(this);
    this.handleUrl=this.handleUrl.bind(this);
    this.handleSubmit=this.handleSubmit.bind(this);
  }
  handleName(e){
    this.setState({name:e.target.value})
  }
  handleDesc(e){
    this.setState({description:e.target.value})
  }
  handleUrl(e){
    this.setState({import_url:e.target.value})
  }
  handleSubmit(e){
    e.preventDefault();
    this.props.dispatch(newRepo(this.state));
  }

  render() {
    console.log("new",this.props.newrepo);
    console.log(this.props);
    if(this.props.newrepo!==undefined && this.props.newrepo!==false) this.props.history.push(`/newrepo/contract/${this.props.newrepo.username}/${this.props.newrepo.project_name}/`)
    return (
      <div className="NewRepoPage">
        <Typography variant="display4">New Repo</Typography>
        <div className="Form">
          <TextField
            id="name-input"
            label="Repo Name"
            value={this.state.name}
            onChange={this.handleName}
            margin="normal"
          />
          <TextField
            id="description-input"
            label="Repo Description (optional)"
            value={this.state.description}
            onChange={this.handleDesc}
            margin="normal"
          />
          <TextField
            id="url-input"
            label="Import URL (optional)"
            value={this.state.import_url}
            onChange={this.handleUrl}
            margin="normal"
          />
          <Button variant="raised" color="primary" className="SubmitButton" onClick={this.handleSubmit}>Create Repo</Button>
        </div>
      </div>
    );
  }
}


const mapStateToProps = (state) => {
  return {
    newrepo: state.repos.data,
    }
}

export default connect(mapStateToProps)(NewRepoPage);
